/* harmony default export */ __webpack_exports__["default"] = ("<app-navbar></app-navbar>\n\n<div class=\"parallax\" style=\"height: 350px; background-image: url('../../assets/blog/organisation/header.jpg');\">\n  <div class=\"imageTextCollage\"><a class=\"photoCred\" style=\"margin-top: 300px; float: right;\" href=\"https://unsplash.com/@huntersrace\" target=\"_blank\" rel=\"noopener noreferrer\" title=\"Download free do whatever you want high-resolution photos from Taylor Smith\"><span style=\"display:inline-block;padding:2px 3px\"><svg xmlns=\"http://www.w3.org/2000/svg\" style=\"height:12px;width:auto;vertical-align:middle;top:-2px;fill:white\" viewBox=\"0 0 32 32\"><title>unsplash-logo</title><path d=\"M10 9V0h12v9H10zm12 5h10v18H0V14h10v9h12v-9z\"></path></svg></span><span style=\"display:inline-block;padding:2px 3px\">Hunters Race</span></a></div>\n</div>\n<div class=\"category-card\">\n  <br><h1><strong>Organisation</strong></h1><br>\n</div>\n<div class=\"post-list\">\n  <br><br>\n  <div class=\"search-container\">\n    <input type=\"text\" id=\"myInput\" (keyup)=searchbar() placeholder=\"Search Posts (by title, date, year..)\" title=\"SearchBar\"><br><br>\n    <div id=\"myUL\">\n      <div id=\"no-results\">\n        <br>\n        <h2><strong>There are no matching results</strong></h2>\n        <h4>We apologise! Please try searching something else.</h4>\n        <br><br>\n      </div>\n      <!-- How To Organise Your Web Browsing -->\n      <section>\n        <div class=\"blog-item\">\n          <h2><strong>How To Organise Your Web Browsing</strong></h2><h4>25 May 2020</h4><br>\n          <div class=\"article-preview-image\" style=\"height:300px;background-image:url('../../assets/blog/organisation/organise-web-browsing/cropped.jpg');background-size:cover\"></div><br>\n          <p class=\"description\">These days, many people spend most of their time surfing the web or conducting important business online. It makes sense to have your accounts, passwords, general online activities and frequently used websites organised in... </p>\n          <br><br>\n          <div class=\"read-more-project-button-container\">\n            <a routerLink=\"/blog/organisation/how-to-organise-your-web-browsing\" class=\"button read-more-button second-button\">Read More >></a>\n          </div>\n          <br><br>\n        </div>\n      </section>\n      <!-- 24 Ways To Be More Organised -->\n      <section>\n        <div class=\"blog-item second\">\n          <br><br>\n          <h2><strong>24 Ways To Be More Organised</strong></h2><h4>19 May 2020</h4><br>\n          <div class=\"article-preview-image\" style=\"height:300px;background-image:url('../../assets/blog/organisation/how-to-be-better-organised/cropped.jpg');background-size:cover\"></div><br>\n          <p class=\"description\">There's a lot of people who admit that they would like to be more organised. Unfortunately, being fully organised in most aspects of life is a habit that takes time to build (it doesn't happen overnight!). That being said - it is... </p>\n          <br><br>\n          <div class=\"read-more-project-button-container\">\n            <a routerLink=\"/blog/organisation/ways-to-be-more-organised\" class=\"button read-more-button first-button\">Read More >></a>\n          </div>\n          <br><br>\n        </div>\n      </section>\n      <!-- 10 Tips To Better Organise Your Computer -->\n      <section>\n        <div class=\"blog-item first\">\n          <br><br>\n          <h2><strong>10 Tips To Better Organise Your Computer</strong></h2><h4>16 May 2020</h4><br>\n          <div class=\"article-preview-image\" style=\"height:300px;background-image:url('../../assets/blog/organisation/better-organise-your-files/cropped.jpg');background-size:cover\"></div><br>\n          <p class=\"description\">Having a well organised computer can improve your overall workflow and efficiency. If your computer has too many files, it can clutter your vision and distract you by making it difficult to find what you are looking for. Here are a... </p>\n          <br><br>\n          <div class=\"read-more-project-button-container\">\n            <a routerLink=\"/blog/organisation/tips-to-better-organise-your-computer\" class=\"button read-more-button second-button\">Read More >></a>\n          </div>\n          <br><br>\n        </div>\n      </section>\n      <!-- How to avoid Procrastinating -->\n      <section>\n        <div class=\"blog-item second\">\n          <br><br>\n          <h2><strong>How To Avoid Procrastinating</strong></h2><h4>Coming Soon!</h4><br>\n          <div class=\"article-preview-image\" style=\"height:300px;background-image:url('../../assets/blog/organisation/avoid-procrastination/cropped.jpg');background-size:cover\"></div><br>\n          <!-- <p class=\"description\">These days, many people spend most of their time surfing the web or conducting important business online. It makes sense to have your accounts, passwords, general online activities and frequently used websites organised in... </p> -->\n          <br><br>\n          <div class=\"read-more-project-button-container\">\n            <a routerLink=\"/blog/organisation/tips-to-avoid-procrastinating\" class=\"button read-more-button first-button\">Read More >></a>\n          </div>\n          <br><br>\n        </div>\n      </section>\n    </div>\n  </div>\n</div>\n<div class=\"card\">\n  <br><h2 class=\"sidebar-bottom-headings\">FOLLOW ME</h2><h5 class=\"fadedText\">__________________</h5><br>\n  <div style=\"text-align:center\">\n  <a href=\"https://www.instagram.com/vondreii\"><img src=\"../../assets/social/instagram.png\" alt=\"image\"/></a><span style=\"padding:10px\"></span>\n  <a href=\"https://www.linkedin.com/in/sharlene-von-drehnen\"><img src=\"../../assets/social/linkedin.png\" alt=\"image\"/></a><span style=\"padding:10px\"></span>\n  <a href=\"https://github.com/vondreii\"><img src=\"../../assets/social/github.png\" alt=\"image\"/></a><span style=\"padding:10px\"></span>\n  </div>\n  <br><br>\n</div>");

